import React, { useState, useEffect } from 'react';
import ApiService from '../../services/api';

const SubscriptionManagement = () => {
  const [activeTab, setActiveTab] = useState('overview');
  const [selectedFilter, setSelectedFilter] = useState('all');
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');
  const [success, setSuccess] = useState('');

  // Data states
  const [subscriptionPlans, setSubscriptionPlans] = useState([]);
  const [subscriptionStats, setSubscriptionStats] = useState([]);
  const [subscribers, setSubscribers] = useState([]);
  const [billingHistory, setBillingHistory] = useState([]);

  // Modal states
  const [showCreateModal, setShowCreateModal] = useState(false);
  const [showEditModal, setShowEditModal] = useState(false);
  const [showFeaturesModal, setShowFeaturesModal] = useState(false);
  const [showAddBillingModal, setShowAddBillingModal] = useState(false);
  const [selectedPlan, setSelectedPlan] = useState(null);

  // Form states
  const [planForm, setPlanForm] = useState({
    name: '',
    description: '',
    monthly_price: '',
    yearly_price: '',
    max_properties: '',
    analytics_enabled: false,
    staff_management_enabled: false,
    subdomain_access: false,
    priority_support: false,
    api_access: false,
    advanced_reporting: false,
    is_active: true,
    trial_days: 0
  });

  // Billing form state
  const [billingForm, setBillingForm] = useState({
    customer_name: '',
    email: '',
    plan_name: '',
    amount: '',
    billing_date: '',
    payment_method: 'Credit Card',
    status: 'pending',
    invoice_number: ''
  });

  // Load subscription plans and data
  useEffect(() => {
    fetchSubscriptionPlans();
    fetchSubscriptionStats();
  }, []);

  const fetchSubscriptionPlans = async () => {
    try {
      setLoading(true);
      const response = await ApiService.getAdminSubscriptionPlans();
      setSubscriptionPlans(response.data || response || []);
    } catch (error) {
      console.error('Error fetching subscription plans:', error);
      setError('Failed to load subscription plans');
    } finally {
      setLoading(false);
    }
  };

  const fetchSubscriptionStats = async () => {
    try {
      const response = await ApiService.getAdminSubscriptionStats();
      const stats = response.data || response || {};
      setSubscriptionStats([
        { title: 'Total Subscribers', value: String(stats.total_subscribers || 0), change: '+0%', icon: 'users', color: 'text-black' },
        { title: 'Active Subscriptions', value: String(stats.active_subscriptions || 0), change: '+0%', icon: 'check', color: 'text-black' },
        { title: 'Monthly Revenue', value: `₱${(stats.monthly_revenue || 0).toLocaleString()}`, change: '+0%', icon: 'money', color: 'text-black' },
        { title: 'Pending Renewals', value: String(stats.pending_renewals || 0), change: '+0%', icon: 'clock', color: 'text-black' }
      ]);
    } catch (error) {
      console.error('Error fetching subscription stats:', error);
    }
  };

  // Fetch functions for new tabs
  const fetchSubscribers = async () => {
    try {
      const response = await ApiService.getAdminSubscribers();
      setSubscribers(response.data || []);
    } catch (error) {
      console.error('Error fetching subscribers:', error);
    }
  };

  const fetchBillingHistory = async () => {
    try {
      const response = await ApiService.getAdminBillingHistory();
      setBillingHistory(response.data || []);
    } catch (error) {
      console.error('Error fetching billing history:', error);
    }
  };

  // Load data based on active tab
  useEffect(() => {
    if (activeTab === 'subscribers') {
      fetchSubscribers();
    } else if (activeTab === 'billing') {
      fetchBillingHistory();
    }
  }, [activeTab]);

  // Form handlers
  const handleInputChange = (e) => {
    const { name, value, type, checked } = e.target;
    setPlanForm(prev => ({
      ...prev,
      [name]: type === 'checkbox' ? checked : value
    }));
  };

  const handleBillingInputChange = (e) => {
    const { name, value } = e.target;
    setBillingForm(prev => ({
      ...prev,
      [name]: value
    }));
  };

  const resetForm = () => {
    setPlanForm({
      name: '',
      description: '',
      monthly_price: '',
      yearly_price: '',
      max_properties: '',
      analytics_enabled: false,
      staff_management_enabled: false,
      subdomain_access: false,
      priority_support: false,
      api_access: false,
      advanced_reporting: false,
      is_active: true,
      trial_days: 0
    });
    setSelectedPlan(null);
    setError('');
    setSuccess('');
  };

  const resetBillingForm = () => {
    setBillingForm({
      customer_name: '',
      email: '',
      plan_name: '',
      amount: '',
      billing_date: '',
      payment_method: 'Credit Card',
      status: 'pending',
      invoice_number: ''
    });
    setError('');
    setSuccess('');
  };

  const handleAddBilling = async (e) => {
    e.preventDefault();
    try {
      setLoading(true);
      setError('');

      // Prepare billing data for API
      const billingData = {
        customer_name: billingForm.customer_name,
        customer_email: billingForm.email,
        plan_name: billingForm.plan_name,
        amount: parseFloat(billingForm.amount),
        due_date: billingForm.billing_date || new Date().toISOString().split('T')[0],
        payment_method: billingForm.payment_method,
        status: billingForm.status,
        bill_type: 'subscription',
        invoice_number: billingForm.invoice_number || undefined,
        notes: `Manually created by admin`
      };

      // Call API to create billing entry
      const response = await ApiService.createBillingEntry(billingData);

      // Update local state with the new billing entry
      setBillingHistory(prev => [response.data, ...prev]);

      setSuccess('Billing entry created successfully!');
      setShowAddBillingModal(false);
      resetBillingForm();

      // Refresh billing history to get latest data
      fetchBillingHistory();

      // Auto-dismiss success message
      setTimeout(() => setSuccess(''), 3000);
    } catch (error) {
      setError(error.message || 'Failed to create billing entry');
      setTimeout(() => setError(''), 5000);
    } finally {
      setLoading(false);
    }
  };

  // CRUD Operations
  const handleCreatePlan = async (e) => {
    e.preventDefault();
    try {
      setLoading(true);
      setError('');

      const response = await ApiService.createSubscriptionPlan(planForm);

      // If we get here without throwing, it was successful
      setSuccess('Subscription plan created successfully!');
      setShowCreateModal(false);
      resetForm();
      fetchSubscriptionPlans();
      fetchSubscriptionStats();

      // Auto-dismiss success message
      setTimeout(() => setSuccess(''), 3000);
    } catch (error) {
      setError(error.message || 'Failed to create subscription plan');
      // Auto-dismiss error message
      setTimeout(() => setError(''), 5000);
    } finally {
      setLoading(false);
    }
  };

  const handleEditPlan = async (e) => {
    e.preventDefault();
    try {
      setLoading(true);
      setError('');

      const response = await ApiService.updateSubscriptionPlan(selectedPlan.id, planForm);

      // If we get here without throwing, it was successful
      setSuccess('Subscription plan updated successfully!');
      setShowEditModal(false);
      resetForm();
      fetchSubscriptionPlans();
      fetchSubscriptionStats();

      // Auto-dismiss success message
      setTimeout(() => setSuccess(''), 3000);
    } catch (error) {
